Chop Socky Chooks - Season 1 - Episodes 1 to 13 (SD - WEB-DL)
-------------------------------------------------------------

The Chop Socky Chooks are a crack team of Kung Fu Chickens who work undercover to
combat their arch-enemy, Dr Wasabi and his monstrous schemes for world domination.
Our trio of super-cool heroes dedicate their lives to defending the citizens of
Wasabi World, the world's biggest shopping mall. The philosophical Chuckie Chan,
the streetwise KO Joe and the enigmatic Chick P use a combination of martial arts
skills, hi-tech computer wizardry and razor-sharp wits to defend the innocent
shoppers of Wasabi World from the evil mastermind's diabolical plots - be they
prehistoric Ptero-Budgies or deadly Karaoke Zombies!

Produced by Aardman Animations and Decode Entertainment.

